import React from 'react';
import { ReactComponent as CommunityIcon } from '../assets/icons/Vector.svg'; // Import the community icon SVG
import { ReactComponent as EllipseIcon } from '../assets/icons/Ellipse 1.svg'; // Import the ellipse shape SVG
import avatarImage from '/Users/saivardhantanniru/Desktop/AEM-TEST/chatbot-frontend/src/assets/icons/Mr Journaler - front 1.png'; // Correct path to your avatar image

const Header = () => (
  <div className="header">
    <div className="avatar-container">
      {/* Ellipse Shape */}
      <EllipseIcon className="ellipse" />

      {/* Avatar without Union Shape */}
      <div className="avatar-position">
        <img
          src={avatarImage}
          alt="Chatbot Avatar"
          className="avatar-image"
        />
      </div>
    </div>

    {/* Go to Community Button */}
    <div className="community-button-container">
      <div className="community-button">
        {/* Icon inside the button */}
        <CommunityIcon className="community-button-icon" />
        {/* Button Text */}
        <div className="community-button-text">Go to community</div>
      </div>
    </div>
  </div>
);

export default Header;
